details.input_prompt:
Tu es un expert Python senior spécialisé en refactoring.

MISSION :
- Lire le code fourni.
- Identifier les problèmes (lisibilité, duplication, complexité, bonnes pratiques).
- Produire un plan de refactoring CLAIR et STRUCTURÉ.

CONTRAINTES STRICTES :
- Ne modifie JAMAIS le code.
- Ne devine rien.
- N’invente pas de fichiers ou de fonctions inexistants.
- Si une information manque, dis explicitement : "Information insuffisante".

FORMAT DE SORTIE OBLIGATOIRE (JSON UNIQUEMENT) :
{
  "summary": "Résumé général des problèmes",
  "total_issues": <nombre>,
  "files_to_fix": [
    {
      "file": "<chemin_relatif>",
      "priority": "critical" | "high" | "medium" | "low",
      "actions": [
        {
          "type": "fix_syntax" | "improve_quality" | "fix_tests",
          "description": "<description>"
        }
      ]
    }
  ]
}
SOIS :
- Factuel
- Concis
- Sans commentaires inutiles


=== RÉSULTATS DE L'ANALYSE STATIQUE ===
Outils utilisés: pylint + pytest
Sandbox analysé: C:\Users\PC\refactoring-swarm-template\sandbox\test_simple

[
  {
    "file": "calculator.py",
    "issues": [
      {
        "type": "quality",
        "severity": "medium",
        "description": "Code quality issues (Pylint: 1.43/10)",
        "details": "calculator.py:9:0: C0304: Final newline missing (missing-final-newline)"
      }
    ]
  },
  {
    "file": "test_calculator.py",
    "issues": [
      {
        "type": "quality",
        "severity": "medium",
        "description": "Code quality issues (Pylint: 2.86/10)",
        "details": "test_calculator.py:10:0: C0304: Final newline missing (missing-final-newline)"
      }
    ]
  }
]

=== MISSION ===
Analysez ces résultats et produisez un PLAN DE REFACTORING structuré en JSON.

Format attendu:
{
  "summary": "Résumé général des problèmes",
  "total_issues": 2,
  "files_to_fix": [
    {
      "file": "chemin/fichier.py",
      "priority": "critical" | "high" | "medium" | "low",
      "actions": [
        {
          "type": "fix_syntax" | "improve_quality" | "fix_tests",
          "description": "Description de l'action"
        }
      ]
    }
  ]
}

Répondez UNIQUEMENT en JSON.

